import React, { useEffect, useState } from "react";

const Give = () =>{
    const [allEmployes,setAllEmployes] = useState([])

    useEffect(() => {    
        let content = {
            method: "GET",
        };

    // TODO fixed the data of bon de commande to 1
        fetch("http://127.0.0.1:3000/give", content)
        .then((response) => {
            return response.json();
        })
        .then((json) => {
            setAllEmployes(json)
        })
    },[]);

    return(
        <div id="indro">
            { allEmployes.map(employe=>(
                <div id="fandehany">
                    <div>{employe.email}</div>
                </div>
            ))
            }
        </div>
    );

}

export default Give;
